# from 0x4080 to 0x7e80
hex_string = ''
# Создаем буфер, применяем смещение 0x37 к каждому байту и выводим результат
buf = bytes([(byte := int(hex_string[i:i+2], 16)) ^ 0x37 for i in range(0, len(hex_string), 2)])

with open('raw_flag', 'wb') as output_file:
    output_file.write(buf)


